	function get_vocabulary($module = "", $sub_module = "", $control_name = ""){		
		if($module != "" && $sub_module != "" && $control_name != ""){
			return $this->vocabulary[$module][$sub_module][$control_name];
		}else if($module != "" && $sub_module != ""){
			return $this->vocabulary[$module][$sub_module];
		}else if($module != ""){
			return $this->vocabulary[$module];
		}else{
			return $this->vocabulary;
		}
	}
}
